import axios from "axios";
import { useEffect } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";

function Card(props) {
  useEffect(() => {
    props.dispatch({
      type: "GET_MOVIES_DETAIL",
    });
  }, []);
  return (
    <div className="play-list-section mt-3 ml-4 mr-4">
      <div className="container">
        <div className="row">
          {props.getMoviesDetail?.length > 0 &&
            props.getMoviesDetail.map((each, index) => {
              console.log(each);
              return (
                <div className="card">
                  <img
                    src={"./video_banner/" + each.replace(".mp4", "") + ".jpg"}
                    className="card-img-top"
                    alt={each.replace(".mp4", "")}
                  />
                  <div className="card-body">
                    <h5 className="card-title">{each.replace(".mp4", "")}</h5>
                    <p className="card-text">
                      Enjoy {each.replace(".mp4", "").replace("-", " ")}
                    </p>
                    <a href="#" className="btn btn-primary">
                      Play
                    </a>
                  </div>
                </div>
              );
            })}
        </div>
      </div>
    </div>
  );
}
Card = withRouter(Card);
export default connect(function (state, action) {
  return {
    getMoviesDetail: state?.get_detail,
  };
})(Card);
